import React from 'react';
import logo from '../../img/logo-187x66.png';
import burger from '../../img/icon/burgerIcon.png'
import classes from './Navigation.module.css'
import {NavLink} from "react-router-dom";



const  Navigation = (props) =>{

let qwert = React.createRef();
let alert = ()=>{
  console.log(qwert.current)
};

    let menuDate = props.menuData;
    let f=()=>{
        console.log(menuDate);
        for (let i=0; i<menuDate.length; i++){
            menuDate.map(e=> (
                <li className={classes.li_dropdoun}>
                    <a href={e.url}>{e.label}</a>
                </li>
            ))
        }
    };

    return (
        <div className={classes.block}>
            <div className={classes.item_img}>
                <img src={logo} alt=""/>
            </div>
            <div onClick={alert} className={classes.burger}>
                <img src={burger} alt=""/>
            </div>
            <div className={classes.item_menu}>

                <ul className={classes.ul_menu}>
                    <li className={classes.li_menu}><NavLink exact to="/" activeClassName={classes.active}>Home</NavLink></li>
                    <li className={classes.li_menu}><NavLink to="/about" activeClassName={classes.active}>About</NavLink></li>
                    <li  className={`${classes.li_menu} ${classes.li_block}`}><NavLink to="#" activeClassName={classes.active}>Service&#8195;&#709;</NavLink>
                        <ul ref={qwert} className={`${classes.ul_dropdoun} ${classes.displayNone}`}>
                            <li className={classes.li_dropdoun}><NavLink to="" activeClassName={classes.active}>IOS app development</NavLink></li>
                            <li className={classes.li_dropdoun}><NavLink to="" activeClassName={classes.active}>android app development</NavLink></li>
                            <li className={classes.li_dropdoun}><NavLink to="" activeClassName={classes.active}>websites development services</NavLink></li>
                            <li className={classes.li_dropdoun}><NavLink to="" activeClassName={classes.active}>unity 3D game development</NavLink></li>
                            <li className={classes.li_dropdoun}><NavLink to="" activeClassName={classes.active}>digital marketing services</NavLink></li>
                            <li className={classes.li_dropdoun}><NavLink to="" activeClassName={classes.active}>UI/UX design services</NavLink></li>
                        </ul>
                    </li>
                    <li className={classes.li_menu}><NavLink to="/portfolio" activeClassName={classes.active}>Portfolio</NavLink></li>
                    <li className={classes.li_menu}><NavLink to="/blog" activeClassName={classes.active}>Blog</NavLink></li>
                    <li className={classes.li_menu}><NavLink to="/contact" activeClassName={classes.active}>Contact</NavLink></li>
                </ul>
                <div className={classes.btn}>
                    <button className={classes.btn1}>get a free quote</button>
                    <button className={classes.btn2}>
                        call <big>&#128381;</big>
                    </button>
                </div>

            </div>


        </div>
    );
};

export default Navigation;
